import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';

const Hero = () => {
  const [displayText, setDisplayText] = useState('');
  const [currentIndex, setCurrentIndex] = useState(0);
  const texts = ['Full Stack Developer', 'React Developer', 'Problem Solver'];

  useEffect(() => {
    let i = 0;
    const currentText = texts[currentIndex];
    const typeWriter = () => {
      if (i < currentText.length) {
        setDisplayText(currentText.slice(0, i + 1));
        i++;
        setTimeout(typeWriter, 120);
      } else {
        setTimeout(() => {
          setDisplayText('');
          i = 0;
          setCurrentIndex((prev) => (prev + 1) % texts.length);
        }, 3000);
      }
    };
    typeWriter();
  }, [currentIndex]);

  const particleVariants = {
    animate: {
      y: [-20, 20],
      opacity: [0.2, 1, 0.2],
      scale: [0.8, 1.2, 0.8],
      transition: {
        duration: 4,
        repeat: Infinity,
        ease: "easeInOut"
      }
    }
  };

  return (
    <section id="home" className="min-h-screen flex items-center justify-center relative overflow-hidden pt-24">
      {/* Advanced Gradient Background */}
      <div className="absolute inset-0 bg-gradient-to-br from-purple-900 via-blue-900 to-indigo-900 dark:from-gray-900 dark:via-purple-900 dark:to-black"></div>



      <motion.div 
        className="relative z-10 text-center text-white max-w-4xl mx-auto px-4 sm:px-6"
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 1 }}
      >
        {/* Profile Image */}
        <div className="w-24 h-24 sm:w-32 sm:h-32 mx-auto mb-6 sm:mb-8 relative">
          <div className="w-full h-full bg-gradient-to-r from-purple-400 to-pink-400 rounded-full flex items-center justify-center text-2xl sm:text-4xl font-bold shadow-2xl">
            VP
          </div>
        </div>

        <h1 className="text-3xl sm:text-5xl md:text-7xl font-bold mb-4 sm:mb-6 bg-gradient-to-r from-white via-purple-200 to-pink-200 bg-clip-text text-transparent leading-tight">
          Vishesh Panchal
        </h1>

        <div className="text-lg sm:text-2xl md:text-3xl font-light mb-6 sm:mb-8 h-8 sm:h-12 flex items-center justify-center">
          <span className="text-yellow-300 font-medium">{displayText}</span>
          <span className="text-white ml-1 animate-pulse">|</span>
        </div>

        <p className="text-base sm:text-lg md:text-xl text-gray-300 mb-8 sm:mb-10 max-w-2xl mx-auto leading-relaxed px-2">
          Crafting digital experiences with modern technologies. Passionate about creating innovative solutions that make a difference.
        </p>

        <motion.div 
          className="flex flex-col sm:flex-row gap-4 sm:gap-6 justify-center items-center px-4"
          initial={{ opacity: 0, y: 30 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 1.3 }}
        >
          <motion.a
            href="#projects"
            className="group relative px-6 sm:px-8 py-3 sm:py-4 bg-gradient-to-r from-purple-600 to-pink-600 rounded-full text-white font-semibold overflow-hidden shadow-2xl w-full sm:w-auto text-center"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            <span className="relative z-10 flex items-center justify-center gap-2">
              <i className="fas fa-rocket"></i>
              <span className="text-sm sm:text-base">Explore My Work</span>
            </span>
            <motion.div
              className="absolute inset-0 bg-gradient-to-r from-pink-600 to-purple-600"
              initial={{ x: "100%" }}
              whileHover={{ x: 0 }}
              transition={{ duration: 0.3 }}
            />
          </motion.a>

          <motion.a
            href="#contact"
            className="group px-6 sm:px-8 py-3 sm:py-4 border-2 border-white/30 backdrop-blur-sm rounded-full text-white font-semibold hover:bg-white/10 transition-all duration-300 w-full sm:w-auto text-center"
            whileHover={{ scale: 1.05, borderColor: "rgba(255,255,255,0.8)" }}
            whileTap={{ scale: 0.95 }}
          >
            <span className="flex items-center justify-center gap-2">
              <i className="fas fa-paper-plane"></i>
              <span className="text-sm sm:text-base">Let's Connect</span>
            </span>
          </motion.a>
        </motion.div>

        {/* Social Links */}
        <motion.div
          className="flex justify-center gap-4 sm:gap-6 mt-8 sm:mt-12"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ duration: 0.8, delay: 1.5 }}
        >
          {[
            { icon: 'fab fa-github', url: 'https://github.com/visheshpanchal27', color: 'hover:text-gray-400' },
            { icon: 'fab fa-linkedin', url: 'https://www.linkedin.com/in/vishesh-panchal-144281353', color: 'hover:text-blue-400' },
            { icon: 'fab fa-twitter', url: 'https://twitter.com/visheshpanchal', color: 'hover:text-sky-400' }
          ].map((social, index) => (
            <motion.a
              key={index}
              href={social.url}
              target="_blank"
              rel="noopener noreferrer"
              className={`text-xl sm:text-2xl text-white/70 ${social.color} transition-all duration-300 p-2`}
              whileHover={{ scale: 1.2, y: -5 }}
              whileTap={{ scale: 0.9 }}
            >
              <i className={social.icon}></i>
            </motion.a>
          ))}
        </motion.div>

        <motion.div
          className="mt-12 sm:mt-16"
          animate={{ y: [0, 10, 0] }}
          transition={{ duration: 2, repeat: Infinity }}
        >
          <a href="#about" className="text-white/70 hover:text-white transition-colors group">
            <div className="flex flex-col items-center gap-1 sm:gap-2">
              <span className="text-xs sm:text-sm font-medium">Discover More</span>
              <motion.i 
                className="fas fa-chevron-down text-lg sm:text-xl group-hover:text-purple-300"
                animate={{ y: [0, 5, 0] }}
                transition={{ duration: 1.5, repeat: Infinity }}
              ></motion.i>
            </div>
          </a>
        </motion.div>
      </motion.div>
    </section>
  );
};

export default Hero;
